import React, { useState } from "react";
import Card from "../weather_card/card";

let valuee = "";
const Field = () => {
  const [val, setVal] = useState("India");
  valuee = val;
  return (
    <>
      <input
        type="text"
        value={val}
        onChange={(e) => {
          setVal(e.target.value);
        }}
      />
      <input
        type="Submit"
        onClick={() => {
          valuee = val;
        }}
      />
      <Card name={valuee} />
    </>
  );
};

export default Field;
